import react from "react";
import "./header.css";
const Header = () => {
  return (
    <header className="container">
      <div className="header">
        <div className="logo"><img src="/images/Logo-header.svg" alt="Logo" /></div>
        <a
            name=""
            id=""
            class="btn btn-primary"
            href="#"
            role="button"
            >Button</a
        >
        
      </div>
    </header>
  );
};

export default Header;
